import React from "react";
import "./LandingPage.css";

function Landing(props) {
    return (
        <div id="landing">
            <h1>Anneliese Wen</h1>
            <img id="landing-art" src={require("../Assets/land-artwork.jpg")}/>
        </div>
    )
}

export default Landing;
